  const [number, setNumber] = useState(0);

  function onClick() {
    setNumber(50);
  }

  return (
    <div className = "text">
      <div> ê°’ : {number} </div>
      <Title />
      <img className = "img" onClick={onClick} src={logo} alt="aa"/>
      <Subject />
    </div>
  );
}

export default App;
